console.log("Hello from the Client Script!");var myApp=angular.module("myApp",["ngRoute"]);myApp.config(["$routeProvider",function(a){a.when("/home",{templateUrl:"/views/partials/home.html",controller:"homeController"}).when("/about",{templateUrl:"/views/partials/about.html",controller:"aboutController"}).when("/photo",{templateUrl:"/views/partials/photo.html",controller:"photoController"}).when("/video",{templateUrl:"/views/partials/video.html",controller:"videoController"}).when("/web",{templateUrl:"/views/partials/web.html",controller:"webController"}).otherwise({redirectTo:"/home"})}]);